import "./header.css";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";

const Header = () => {
  return (
    <div className="header">
      <div className="headerList">
        <div className="headerListitem">
          <FontAwesomeIcon icon="fa-solid fa-bed" />
        </div>
      </div>
    </div>
  );
};

export default Header;
